def main():
    # Training settings

#    task.connect(args)

    param_dict2 = {
        'batch-size': '256',
        'test-batch-size': '64',
        'epochs': '24',
        'lr': '0.05',
        'momentum': '0.75',
        'no-cuda': False,
        'seed': '999',
        'log-interval': '100',
    }

    task.connect(param_dict2, 'OtherParams')

    label_conf_dict = {
        "airplane": 0,
        "bicycle": 1,
        "bird": 2,
        "boat": 3,
        "bottle": 4,
        "bus": 5,
        "car": 6,
        "cat": 7,
        "chair": 8,
        "cow": 9,
        "dining table": 10,
        "dog": 11,
        "horse": 12,
        "motorcycle": 13,
        "person": 14,
        "potted plant": 15,
        "sheep": 16,
        "train": 17,
        "tv": 18
    }

    config_file = os.path.join('configs', 'task.config')
    task.connect_configuration(config_file)

    task.connect_label_enumeration(label_conf_dict)

    writer = SummaryWriter('runs')
    writer.add_text('TEXT', 'This is some text', 0)

    mnist = tf.keras.datasets.mnist

    args.cuda = not args.no_cuda and torch.cuda.is_available()

    torch.manual_seed(args.seed)
    if args.cuda:
        torch.cuda.manual_seed(args.seed)

    kwargs = {'num_workers': 4, 'pin_memory': True} if args.cuda else {}
    train_loader = torch.utils.data.DataLoader(datasets.MNIST('../data', train=True, download=True,
                                                              transform=transforms.Compose([
                                                                  transforms.ToTensor(),
                                                                  transforms.Normalize((0.1307,), (0.3081,))])),
                                               batch_size=args.batch_size, shuffle=True, **kwargs)
    test_loader = torch.utils.data.DataLoader(datasets.MNIST('../data', train=False,
                                                             transform=transforms.Compose([
                                                                 transforms.ToTensor(),
                                                                 transforms.Normalize((0.1307,), (0.3081,))])),
                                              batch_size=args.test_batch_size, shuffle=True, **kwargs)

    model = Net()

    #task.connect_configuration(model.state_dict())

    if args.cuda:
        model.cuda()
    optimizer = optim.SGD(model.parameters(), lr=args.lr, momentum=args.momentum)

    for epoch in range(1, args.epochs + 1):
        train(model, epoch, train_loader, args, optimizer, writer)
        torch.save(model, os.path.join(gettempdir(), 'model{}'.format(epoch)))
    test(model, test_loader, args, optimizer, writer)

    #imodel = InputModel()
    torch.save(model.state_dict(), os.path.join(gettempdir(), "mnist_cnn.pt"))


if __name__ == "__main__":

    args = get_argparse()

    task = Task.init('examples', args.task_name)

    main()
